var tipuesearch = {"pages": [{'title': 'About', 'text': 'Stage1-bg2: https://40823234.github.io/stage1-bg2/content/index.html \n Stage2-bg2: https://40823234.github.io/stage2-bg2/content/index.html \n Stage3-bg1: https://40823234.github.io/stage3-bg1/content/index.html \n', 'tags': '', 'url': 'About.html'}, {'title': 'work', 'text': '', 'tags': '', 'url': 'work.html'}, {'title': 'w1', 'text': 'Blog \n LEO是存在Config裡 內容是在Markdown 轉html 後是在blog裡 Ctrl i加新節點 Ctrl r往右 Ctrl l往左 Ctrl u往上 Ctrl d往下 @path是設定路徑 @edit 編輯它只能一層 @clean可以多層 @others可以多層管理 \n 更改使用者和名稱 \n \n local-blog複製指令檢查slug有無相同 \n \n 更改為網站網址 \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2 零件繪製', 'text': '零件檔下載 \n 右夾爪.STL \xa0 \xa0 \xa0 左夾爪.STL \xa0 \xa0 \xa0\xa0 夾爪連桿右.STL \xa0 \xa0\xa0 夾爪連桿左.STL \xa0 \xa0 \xa0 縱向軌道.STL \n 橫向軌道.STL \xa0 \xa0\xa0 本體.STL \xa0 \xa0 \xa0 \xa0 偏心圓.STL \xa0 \xa0 \xa0 \xa0 夾爪連接桿.STL \xa0 \xa0 \xa0\xa0 連桿.STL \n \n \n', 'tags': '', 'url': 'w2 零件繪製.html'}, {'title': 'w3 CoppeliaSim 模擬', 'text': '\n \n \n 模擬教學 \n \xa0 \n \n 1.點選file>Import>Mesh選取零件> Up-vector可選取零件擺放之座標>ResizableFloor_5_25點兩下可以調整地板大小 \n \n 2.畫面點右鍵畫面點右鍵>Add>Joint可選擇要加Revolute(旋轉軸)或Prismatic(矩形軸) \n \n 3.將自己零件造作動方式排列順序>旋轉軸點兩下視窗Show dynamic properties鈕點下去勾選Motor enabled可以啟動馬達>零件點選兩下點視窗 Show dynamic properties鈕>會移動的零件都要點Body is dynamic>Body is respondable 指是否實體化 ,若兩個實體化物件互相碰撞 ,會依照物理設定做相對反應。 \n \n \n', 'tags': '', 'url': 'w3 CoppeliaSim 模擬.html'}, {'title': 'w4', 'text': 'w4內容介紹 \n 檔案下載: stage1-bg2.zip \n \n', 'tags': '', 'url': 'w4.html'}, {'title': '問題與解決方法', 'text': '第一次設計: \n \n 經過討論後決的第一次設計出的夾爪只能抓取前方固定範圍距離的物品靈活度太低 \n \n 第二次設計改良: \n \n \n 討論後決定增加橫向軌道與縱向軌道來增加可抓取範圍以增加靈活度增加可抓取範圍 \n \n 第三次設計改良: \n \n \n 加入軌道後發現橫向軌道有傾斜問題導致夾抓無法移動到指定位置 \n \n 第四次設計改良: \n \n \n 為解決橫向傾斜問題我們增加了縱向軌道的寬度來支撐 \n \n', 'tags': '', 'url': '問題與解決方法.html'}, {'title': 'W5', 'text': '\n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'Stage2', 'text': '零件下載 \n 組合.zip \n 容器.zip \n 凸輪.zip \n 主體.zip \n 支架.zip \n \n \n', 'tags': '', 'url': 'Stage2.html'}, {'title': 'W7第一次模擬', 'text': '檔案下載: V-rep1.zip \n 中心桿上的弧線太陡峭導致桿子上的球體卡住 \n \n \n', 'tags': '', 'url': 'W7第一次模擬.html'}, {'title': 'W8第二次模擬', 'text': '檔案下載: V-rep2.zip \n 這次將第一次的弧線改得更平緩但中心桿沒辦法約束到桿件 \n \n', 'tags': '', 'url': 'W8第二次模擬.html'}, {'title': 'W9第三次模擬', 'text': '檔案下載: V-rep3.zip \n 中心軸用了圓柱凸輪來約束桿件但運轉還是不順暢 \n \n', 'tags': '', 'url': 'W9第三次模擬.html'}, {'title': 'stage3', 'text': '', 'tags': '', 'url': 'stage3.html'}, {'title': 'task1', 'text': '指導人員:40823245\xa0 \xa0教學連結: https://40823245.github.io/cd2021/content/task1.html \n def stu2b(account):\n    if account == "40823231":   #學號40823231變成40823231-2\n        return account + "-2"\n    elif account[0:3] == "407":  #學號407xxxxx變成s407xxxxx\n        return "s" + account\n    else:\n        return account                #其他學號按照原本學號\n  \nteamb = []\n  \n# open file, default is read mode, since txt content no chinese char\n# no encoding = "UTF-8" is needed\nwith open("stage3_2b.txt") as fh:       #開啟檔案\n    # readlines will read into the whole line and put into list format\n    # has \\n at the end of each line\n    data = fh.readlines()\n#print(len(data))\nfor i in range(len(data)):\n    group = data[i].rstrip("\\n").split("\\t")\n    teamb.append(group)\n      \noutput = ""    \nseperator = "-"*10 + "<br />"       #分隔線\n  \nfor i in teamb[0:]:\n    team = i[0]                              #小組 組長 其他六個組員\n    leader = stu2b(i[1])\n    m1 = stu2b(i[3])\n    m2 = stu2b(i[5])\n    m3 = stu2b(i[7])\n    m4 = stu2b(i[9])\n    m5 = stu2b(i[11])\n    m6 = stu2b(i[13])\n      \n    try:\n        m7 = stu2b(i[15])               #第七個組員\n    except:\n        m7 = ""\n    try:\n        m8 = stu2b(i[17])               #第八個組員\n    except:\n        m8 = ""\n          \n    leaderrepo = "<a href=\'http://github.com/" + leader + "/cd2021\'>" + leader + " repo</a>"        #組長以及組員的倉儲和網站\n    leadersite = "<a href=\'http://" + leader + ".github.io/cd2021\'>" + leader +  " site</a>"\n    m1repo = "<a href=\'http://github.com/" + m1 + "/cd2021\'>" + m1 + " repo</a>"\n    m1site = "<a href=\'http://" + m1 + ".github.io/cd2021\'>" + m1 +  " site</a>"\n    m2repo = "<a href=\'http://github.com/" + m2 + "/cd2021\'>" + m2 + " repo</a>"\n    m2site = "<a href=\'http://" + m2 + ".github.io/cd2021\'>" + m2 +  " site</a>"\n    m3repo = "<a href=\'http://github.com/" + m3 + "/cd2021\'>" + m3 + " repo</a>"\n    m3site = "<a href=\'http://" + m3 + ".github.io/cd2021\'>" + m3 +  " site</a>"\n    m4repo = "<a href=\'http://github.com/" + m4 + "/cd2021\'>" + m4 + " repo</a>"\n    m4site = "<a href=\'http://" + m4 + ".github.io/cd2021\'>" + m4 +  " site</a>"\n    m5repo = "<a href=\'http://github.com/" + m5 + "/cd2021\'>" + m5 + " repo</a>"\n    m5site = "<a href=\'http://" + m5 + ".github.io/cd2021\'>" + m5 +  " site</a>"\n    m6repo = "<a href=\'http://github.com/" + m6 + "/cd2021\'>" + m6 + " repo</a>"\n    m6site = "<a href=\'http://" + m6 + ".github.io/cd2021\'>" + m6 +  " site</a>"\n   \n  \n    teamrepo = "<a href=\'http://github.com/" + leader + "/" + team + "\'>" + team + " repo</a>"      #小組的倉儲含網站\n    teamsite =  "<a href=\'http://" + m1 + ".github.io/" + team + "\'>" + team +  " site</a>"\n  \n    output += teamrepo + " | " + teamsite + " | " +leaderrepo + " | " + leadersite + " | " +m1repo + " | " + m1site + " | " +m2repo + " | " + m2site + " | " +m3repo + " | " + m3site + " | " +m4repo + " | " + m4site + " | " +m5repo + " | " + m5site + " | " +m6repo + " | " + m6site \n      \n    if m7 != "":\n       m7repo = "<a href=\'http://github.com/" + m7 + "/cd2021\'>" + m7 + " repo</a>"                     #如果有第七個組員會再加倉儲和網站沒有的話就空白\n       m7site = "<a href=\'http://" + m7 + ".github.io/cd2021\'>" + m7 +  " site</a>"   \n       output += " |  " + m7repo + "| " + m7site\n    else:\n        output += "" \n      \n    if m8 != "":\n       m8repo = "<a href=\'http://github.com/" + m8 + "/cd2021\'>" + m8 + " repo</a>"                     #如果有第八個組員會再加倉儲和網站沒有的話就空白最後加分隔線\n       m8site = "<a href=\'http://" + m8 + ".github.io/cd2021\'>" + m8 +  " site</a>"   \n       output += " |  " + m8repo + "| " + m8site \n    else:\n        output += "" \n  \n  \nprint(output)\n# the following will use group data to generate needed html \n \n stage3-bg1 repo  |  stage3-bg1 site  |  40823245 repo  |  40823245 site  |  40823251 repo  |  40823251 site  |  40823208 repo  |  40823208 site  |  40823213 repo  |  40823213 site  |  40823232 repo  |  40823232 site  |  40823234 repo  |  40823234 site  |  40823235 repo  |  40823235 site  |  40823246 repo |  40823246 site ---------- stage3-bg2 repo  |  stage3-bg2 site  |  40823217 repo  |  40823217 site  |  40823201 repo  |  40823201 site  |  40823209 repo  |  40823209 site  |  40823210 repo  |  40823210 site  |  40823206 repo  |  40823206 site  |  40823207 repo  |  40823207 site  |  40823223 repo  |  40823223 site  |  40823224 repo |  40823224 site ---------- stage3-bg3 repo  |  stage3-bg3 site  |  40823236 repo  |  40823236 site  |  40823202 repo  |  40823202 site  |  40823203 repo  |  40823203 site  |  40823212 repo  |  40823212 site  |  40823219 repo  |  40823219 site  |  40823222 repo  |  40823222 site  |  40823231-2 repo  |  40823231-2 site  |  40823244 repo |  40823244 site ---------- stage3-bg4 repo  |  stage3-bg4 site  |  40823239 repo  |  40823239 site  |  s40723140 repo  |  s40723140 site  |  s40723128 repo  |  s40723128 site  |  s40723139 repo  |  s40723139 site  |  s40723106 repo  |  s40723106 site  |  s40723135 repo  |  s40723135 site  |  s40723143 repo  |  s40723143 site  |  s40723215 repo |  s40723215 site ---------- stage3-bg5 repo  |  stage3-bg5 site  |  40823221 repo  |  40823221 site  |  40823204 repo  |  40823204 site  |  40823205 repo  |  40823205 site  |  40823220 repo  |  40823220 site  |  40823228 repo  |  40823228 site  |  40823237 repo  |  40823237 site  |  40823242 repo  |  40823242 site  |  40823250 repo |  40823250 site  |  40832244 repo |  40832244 site ---------- stage3-bg6 repo  |  stage3-bg6 site  |  40823225 repo  |  40823225 site  |  40823214 repo  |  40823214 site  |  40823218 repo  |  40823218 site  |  40823211 repo  |  40823211 site  |  40823248 repo  |  40823248 site  |  40823247 repo  |  40823247 site  |  40823216 repo  |  40823216 site  |  40823238 repo |  40823238 site ---------- stage3-bg7 repo  |  stage3-bg7 site  |  40623144 repo  |  40623144 site  |  40823233 repo  |  40823233 site  |  s40723224 repo  |  s40723224 site  |  40823241 repo  |  40823241 site  |  40423155 repo  |  40423155 site  |  40823227 repo  |  40823227 site  |  s40723233 repo  |  s40723233 site ---------- \n', 'tags': '', 'url': 'task1.html'}, {'title': 'task2', 'text': '', 'tags': '', 'url': 'task2.html'}, {'title': '掃地機器人', 'text': '測試組員:40823245 \n 第一版\xa0 \xa0 \xa0日期:2021/05/05 \n \n 說明:先利用簡單的機構去測試是否遷入成功及程式是否可執行。 \n 第二版 \n \n 注意:本次影片測試速度設定為0故在原地不動。 問題:出現不正常運動軌跡、異常抖動情況。 \n 第三版\xa0 \xa0 \xa0日期:2021/05/06 \n \n 說明:將原本機構簡化判斷是否為機構圖之問題。 \n', 'tags': '', 'url': '掃地機器人.html'}, {'title': '分球機', 'text': '測試人員:40823208\xa0 \xa0 \xa0日期:2021/05/04 \n \xa0第一版 \n \n', 'tags': '', 'url': '分球機.html'}, {'title': 'task2 夾爪機構', 'text': '測試人員:40823234\xa0 \xa0 \xa0日期:2021/05/05 \n \xa0第一版 \n \n 第一版程式: \n import sim as vrep\nimport math\nimport random\nimport time\n \nprint (\'Start\')\n \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.1.114\', 19997, True, True, 5000, 5)\n\nif clientID !=-1:\n    print (\'Connected to remote API server\')\n \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823234",\n        vrep.simx_opmode_oneshot)\n        \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n        \n    opmode = vrep.simx_opmode_oneshot_wait\n    vrep.simxStartSimulation(clientID, opmode)\n    ret, wristHandle = vrep.simxGetObjectHandle(clientID, "VerticalJoint",opmode)\n    vrep.simxSetJointTargetVelocity(clientID,wristHandle,1,opmode)\n    ret, wristHandle = vrep.simxGetObjectHandle(clientID, "SpiritJoint",opmode)\n    vrep.simxSetJointTargetVelocity(clientID,wristHandle,1,opmode)\n    ret, wristHandle = vrep.simxGetObjectHandle(clientID, "joint",opmode)\n    vrep.simxSetJointTargetVelocity(clientID,wristHandle,1,opmode)\nelse:\n    print (\'Failed connecting to  remote API server\')\nprint (\'End\') \n 測試人員:40823234\xa0 \xa0 \xa0日期:2021/05/10 \n 第二版 使用python keyboard \n 檔案下載: REMOTE API.zip \n \n 使用keyboard程式: \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n \nprint (\'Start\')\n \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.1.114\', 19997, True, True, 5000, 5)\n\nif clientID !=-1:\n    print (\'Connected to remote API server\')\n \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823234",\n        vrep.simx_opmode_oneshot)\n        \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n        \n    opmode = vrep.simx_opmode_oneshot_wait\n    vrep.simxStartSimulation(clientID, opmode)\n    ret,vertical_handle=vrep.simxGetObjectHandle(clientID,"VerticalJoint",opmode)#設定軸對應名稱\n    ret,spirit_handle=vrep.simxGetObjectHandle(clientID,"SpiritJoint",opmode)\n    ret,cam_handle=vrep.simxGetObjectHandle(clientID,"joint",opmode)\n    while True:\n        #keyboard "w" 前進\n     if keyboard.is_pressed("w"):\n            print("You pressed w")\n          \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,0.1,opmode)\n     if keyboard.is_pressed("s"):#keyboard "s" 後退\n            print("You pressed s")\n          \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,-0.1,opmode)\n     if keyboard.is_pressed("a"):#keyboard "a"向左 \n            print("You pressed a")\n          \n            vrep.simxSetJointTargetVelocity(clientID,spirit_handle,0.1,opmode)\n     if keyboard.is_pressed("d"):#keyboard "d" 向右\n            print("You pressed d")\n          \n            vrep.simxSetJointTargetVelocity(clientID,spirit_handle,-0.1,opmode)\n     if keyboard.is_pressed("q"):#keyboard "q" 前進後退停止\n            print("You pressed q")\n          \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,0,opmode)\n     if keyboard.is_pressed("e"):#keyboard "e" 左右停止\n            print("You pressed e")\n          \n            vrep.simxSetJointTargetVelocity(clientID,spirit_handle,0,opmode) \n     if keyboard.is_pressed("r"):#keyboard "r" 凸輪轉動\n            print("You pressed r")\n          \n            vrep.simxSetJointTargetVelocity(clientID,cam_handle,1,opmode)   \n     if keyboard.is_pressed("f"):#keyboard "f" 凸輪停止\n            print("You pressed f")\n          \n            vrep.simxSetJointTargetVelocity(clientID,cam_handle,0,opmode)        \nelse:\n    print (\'Failed connecting to  remote API server\')\nprint (\'End\')', 'tags': '', 'url': 'task2 夾爪機構.html'}, {'title': 'W15', 'text': '影片字幕整理 \n 原影片:幾何法 \n \n 中文字幕版: 幾何法 \n \n 原影片:代數法 \n \n 中文字幕版: 代數法 \n \n', 'tags': '', 'url': 'W15.html'}, {'title': 'w16', 'text': 'W16_exam 壓縮檔下載: W16_exam.7z \n Onshape 零件繪製 \n Onshape連結 https://cad.onshape.com/documents/54ba2064aa192862e166a450/w/eabdbc707e030efccdde3883/e/8ad494a807c3d1613913ac39 \n 零件下載: MTB_ROBOT.stl \n \n Onshape零件和場景設定: \n \n \n', 'tags': '', 'url': 'w16.html'}]};